import 'dart:convert';

import 'user.dart';

class SignUpResponse {
	String? message;
	User? user;
	String? accessToken;

	SignUpResponse({this.message, this.user, this.accessToken});

	factory SignUpResponse.from(Map<String, dynamic> data) {
		return SignUpResponse(
			message: data['message'] as String?,
			user: data['user'] == null
						? null
						: User.(data['user'] as Map<String, dynamic>),
			accessToken: data['access_token'] as String?,
		);
	}



	Map<String, dynamic> () {
		return {
			'message': message,
			'user': user?.(),
			'access_token': accessToken,		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [SignUpResponse].
	factory SignUpResponse.fromJson(String data) {
		return SignUpResponse.from(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [SignUpResponse] to a JSON string.
	String toJson() => json.encode(());
}
